import { useState } from "react"
import { CustomLink } from "../navbar"

export default function Register() {
    const [firstName,setFirstName]=useState('')
    const [lastName,setLastName]=useState('')
    const [email,setEmail]=useState('')
    const [birthDay,setBirth]=useState('')
    const [passWord,setPassword]=useState('')
    const [confPass,setConfpass]=useState('')
    
    const [error,setError]=useState(false)
    const [samePass,setsamePass]=useState(false)
    const handleSubmit=(e)=>{
        e.preventDefault()
        if(firstName.length==0||lastName.length==0)(
            setError(true)
        )
        if(passWord==confPass)(
            setsamePass(true)
        )
        console.log(firstName,lastName)
    }

    return (
        <>
        <h1>Register to our website!</h1>
            <form className="form" onSubmit={handleSubmit}>
                <label for="fname">First name</label>
                <input type="text" placeholder="FirstName..." 
                onChange={e=>setFirstName(e.target.value)}>
                </input>
                {error?
                <label className="error">First name cant be empty.</label>:""
                }
                <label for="lname">Last name</label>
                <input type="text" placeholder="LastName..." 
                onChange={e=>setLastName(e.target.value)}>
                </input>
                {error?
                <label className="error">Last name cant be empty.</label>:""
                }

                <label for="email">Email</label>
                <input type="email" placeholder="Email..." 
                onChange={e=>setEmail(e.target.value)}>
                </input>

                <label for="birthday">Birthday:</label>
                <input type="date" id="birthday" name="birthday"
                onChange={e=>setBirth(e.target.value)}>
                </input>

                <label for="pass">Password</label>
                <input type="password" placeholder="Password..."
                onChange={e=>setPassword(e.target.value)}>
                </input>

                <label for="confpass">Confirm Password</label>
                <input type="password" placeholder="Confirm Password..."
                onChange={e=>setConfpass(e.target.value)}>
                </input>
                {samePass?
                <label>The passwords do not match.</label>:""
                }

                <button className="submitbtn">
                    Submit
                </button>
            </form>
        <button className="switchreg"> 
        <CustomLink to="/signin" className="switchreg">Sign Up</CustomLink>
        </button>
        </>
    )
}
